import React from "react";

export default function Results(props) {
    if (props.results) {
        return(
            <div className="Results">
                {props.results.word}
            </div>
        );
    } else {
        return(
            <div className="Results">
                <div className="word">
                    {props.defaultWord}
                </div>
            </div>
        );
    }
}
